\begin{figure}
   \epsfxsize=4.0in \centerline{\epsffile{2cd7h2.eps}}
   \caption[FIG. \arabic{figure}.]{Plots of $e^u$ (blue), $e^{v}$
   (red), $e^{\phi_1/\sqrt2}$ (green) and $e^{\phi_2/\sqrt{10}}$
   (purple) in a smooth solution that runs from AdS$_\5\times H^2$ at
   the horizon to the AdS$_7$-type geometry in the asymptotic region.
   Note that the two scalar curves are almost identical on this scale.
   $m_1=16, m_2=6$, $g=1$, and $c=-0.1$.} \label{2cd7h2fig}
\

